import { makeStyles } from "@material-ui/core/styles";

export const useStyles = makeStyles((theme) => ({
  titulo: {
    fontWeight: "bold",
    border: "1px solid",
    borderRadius: "200px",
    width: "fit-content",
    padding: "10px",
  },
}));
